import React from 'react'

class App extends React.Component {

  state = {
    numero1 : '',
    numero2 : '',
    resultado : ''
  }
  render(){
    return(
      <div>
        <label>Primeiro número</label>
          <input type="text" value={this.state.numero1} 
          onChange={(e) => this.setState({numero1: e.target.value}) } />
          <br />
          <label>Segundo número</label>
          <input type="text" value={this.state.numero1} 
          onChange={(e) => this.setState({numero2: e.target.value}) } />
          <br />
          <button onClick={() => this.setState.resultado({resultado: this.state.numero1 + this.state.numero2})}>
            Somar
          </button>
          O na soma dos 2 numeros é: {this.state.resultado}
      </div>
    )
  }
}

export default App;
